import React from "react";
import ReactDOMServer from "react-dom/server";
import Ticket from "./Ticket"; // import your Ticket component

export const renderTicketToHTML = () => {
  // Render the Ticket component to static HTML
  return ReactDOMServer.renderToStaticMarkup(<Ticket />);
};
